// 消除有有關使用者帳號的localStorage
export function RemoveUser(){
    localStorage.removeItem("UserTK");
    localStorage.removeItem("UserTKTime");
    localStorage.removeItem("LoginUser");
    localStorage.removeItem("LoginMail");
    localStorage.removeItem("StayHere");
};

// 消除有有關Sidebar選項的localStorage
export function RemoveSidebarOption(){
    localStorage.removeItem("OptionIndex");
    localStorage.removeItem("SidebarIndex");
    localStorage.removeItem("OptionIcons");

}

// 消除有有關表單的localStorage
export function RemoveLabel(){
    localStorage.removeItem("ShowManAll");
    localStorage.removeItem("trIndex");
    localStorage.removeItem("MaxPageValue");
    localStorage.removeItem("LabelTitleCost");
    localStorage.removeItem("LabelCotentCost");
    localStorage.removeItem("BtnLabelCotentCost");
    localStorage.removeItem("TrunPage");
    localStorage.removeItem("TrunPageMax");
}
